let state = {
    dialogPage: {
        userData: [
            {"id": 1, "name": "Dmitri"},
            {"id": 2, "name": "Svetlana"},
            {"id": 3, "name": "Nauryz"},
            {"id": 4, "name": "Dinmukhamed"},
            {"id": 5, "name": "Mukhit"}
        ],
        messageData: [
            {"id": 1, "message": "Yo"},
            {"id": 2, "message": "Hello"},
            {"id": 3, "message": "How are you"}
        ]
    },
    profilePage: {
        postsData: [
            {"id": 1, "message": "Hello, how are you?", "likesCount": 5},
            {"id": 2, "message": "My, first post!", "likesCount": 2},
            {"id": 3, "message": "Hello, everyone", "likesCount": 10},
        ]
    }
}

export default state
